import React from 'react';

const Home = () => {
  return (
    <div className="min-h-screen bg-gray-900 text-white">
      <div className="container mx-auto px-4 py-16">
        <h1 className="text-5xl font-bold text-center mb-8">Welcome to MovieVault</h1>
        <p className="text-xl text-center mb-12">Track, manage and discover your favorite movies</p>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 max-w-4xl mx-auto">
          <div className="bg-gray-800 p-6 rounded-lg text-center">
            <h3 className="text-xl font-bold mb-4">Track Movies</h3>
            <p>Keep track of all your favorite movies in one place</p>
          </div>
          <div className="bg-gray-800 p-6 rounded-lg text-center">
            <h3 className="text-xl font-bold mb-4">Organize</h3>
            <p>Organize your collection by genre, year, and more</p>
          </div>
          <div className="bg-gray-800 p-6 rounded-lg text-center">
            <h3 className="text-xl font-bold mb-4">Share</h3>
            <p>Share your movie collection with friends</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
